import React from "react";
import { Form, Field } from 'react-final-form';
// import styles from './final_form.module.css';

const onSubmit = (values) => {
  console.log(values)
};

const validate = (values) => {
  const errors = {}
  const required = values.firstName ? undefined : "Required"
}

const FinalForm = () => {
  return(
    <Form
      onSubmit={onSubmit}
      validate={validate}
      render={({handleSubmit}) => (
        <form onSubmit={handleSubmit}>
          <h2>Final Form</h2>
          {/* <Field name="firstName" component="input" placeholder="Firstname" /> */}
          <div>
            <label>First Name</label>
            <Field name="firstName" component="input" placeholder="First Name" validate={required} />
          </div>

          <button type="submit">Submit</button>
        </form>
      )}
    />
  )
}

export default FinalForm;
